Een jonge familie verhuist naar de andere kant van het land in een idyllisch stadje, met de hoop op een beter leven. Dit wordt echter ruw verstoord door een charismatische, maar emotioneel gestoorde priester. Als de twee tienerzusjes een gevaarlijk spel spelen als onderdeel van een oud ritueel, wordt een demonische kracht ontketend die de familie voor altijd zal veranderen.



